function ExpenseList(props) {
    const expenses = props.data // old expenses list
  return (<div>
        <ExpenseItem name={expenses[0].title} price={expenses[0].amount} date={expenses[0].date}></ExpenseItem>
        <ExpenseItem name={expenses[1].title} price={expenses[1].amount} date={expenses[1].date}></ExpenseItem>
        <ExpenseItem name={expenses[2].title} price={expenses[2].amount} date={expenses[2].date}></ExpenseItem>
    </div>);
}

export default ExpenseList;
